            getOctreeLeafSampleDatas(rootData, sampleDatas[0], sampleDatas[1]);
            setSampleUv(shapePosition, traversalData.octreeCoords, sampleDatas[0]);
            setSampleUv(shapePosition, traversalData.octreeCoords, sampleDatas[1]);
        #endif
